import { useState } from "react";
import Event from "./Event";

const Events = (props) =>
{
    const [events, setEvent] = useState
    ([
        {id: 1, name: 'Линейка', date: '01.09.2023', time: '09:00', body: 'Долгожданная линейка первоклассников', place: 'Задний двор школы'},
        {id: 2, name: 'Родительское собрание', date: '05.09.2023', time: '18:00', body: 'Беседа инспектора с родителями школьников', place: 'Актовый зал'}
    ])


    return (
        <div>
            <h1 style={{textAlign: 'center'}}>Список постов</h1>
            {events.map(event =>
                <Event event = {event} key = {event.id}/>
                )}
        </div>
    )
}

export default Events;
